sys_hub_input_scripts.script:
{"document_id":{"scriptActive":true,"script":"var text = fd_data.subflow_inputs.text;

var prefix = fd_data.flow_var.table_prefix;
var table = fd_data.flow_var.table_name;
var documentId = '';

var taskRegex = new RegExp(prefix + '\\d{7}', 'g');
var taskIndex = text.search(taskRegex);

if (taskIndex != -1) {
 var taskLength = prefix.length + 7;
 var taskNumber = text.substring(taskIndex, taskIndex + taskLength);
 table = table;
 var taskGr = new GlideRecord(table);
 taskGr.get(taskNumber);
 documentId = taskGr.getUniqueValue();
}

return documentId;"}}

